import "../css/index.css";
import "../../../css/all.css";
export default function FloatingeBar() {
  return (
    <div className="main-container">
      <div>
        <div className="icon">
          <i class="fa-solid fa-gamepad"></i>
        </div>
        <div className="icon">
          <i class="fa-solid fa-arrow-up-short-wide"></i>
        </div>
        <div className="icon">
          <i class="fa-solid fa-rocket"></i>
        </div>
      </div>
      <div></div>
    </div>
  );
}
